import './App.css'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>Hello, My name is SUnday ELesi</div>
      <div className="Logo">
        <img src="/images/afia.png" alt="logo" style={{width:'100px', padding:5}} />
      </div>
      </header>
    </div>
  );
}

export default App;
